import styled from "styled-components";


export const Container=styled.div`
height: 520px;
display: flex;
`
export const Right=styled.div`
flex: 2;
border: 1px solid black;
margin-left: 18px;
height: 500px;
`
export const Left=styled.div`
flex: 3;
height: 500px;
`
export const Img=styled.div`
height: 100%;
width: 100%;
border: 1px solid black;
`
